if not self.simulate_sensors:
    return 0
mu, sigma = {io.INPUT_FLOATING: (800, 60), io.INPUT_PULLUP: (4030, 30), io.
    INPUT_PULLDOWN: (80, 30), io.OUTPUT_ON: (4050, 20), io.OUTPUT_OFF: (50, 20)
    }[self.io_configs.get(port, io.INPUT_FLOATING)]
num = int(random.gauss(mu, sigma))
if num < 0:
    num = 0
if num >= 4096:
    num = 4095
return num
